e","source":"# chack new df summary\nsummary(df_nol)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# Create sample df for scatterplot analysis\nsample_size <- 1000\n\nsample_df <- df_nol %>% sample_n(sample_size)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#Histogram of Bed count distribution\nhist_bed <- ggplot(df, aes(x = bed)) +\n  geom_histogram(fill = \"green\", color = \"white\", bins = 300) +\n  labs(title = \"Histogram of Bed Counts\",\n       x = \"Number of Beds\",\n       y = \"Count\") +\n  theme_minimal() +\n  coord_cartesian(xlim = c(1, 5)) +\n  scale_y_continuous(labels = scales::comma)\n\nprint(hist_bed)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#Histogram of Bath count distribution\nhist_bath <- ggplot(df, aes(x = bath)) +\n  geom_histogram(fill = \"blue3\", color = \"white\", bins = 450) +\n  labs(title = \"Histogram of Bath Counts\",\n       x = \"Number of Bath\",\n       y = \"Count\") +\n  theme_minimal() +\n  coord_cartesian(xlim = c(1, 5)) +\n  scale_y_continuous(labels = scales::comma)\n\nprint(hist_bath)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# scatterplot House size vs bath\n#I need to scale to m\nscatter_bath_size <- ggplot(sample_df, aes(x = bath, y = house_size)) +\n  geom_point() +\n  labs(title = \"Scatterplot House size vs Bath\",\n       x = \"Number of Baths\",\n       y = \"House size\") +\n  theme_minimal()\n\nprint(scatter_bath_size)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# scatterplot House size vs bed\n#I need to scale to m\nscatter_bed_size <- ggplot(sample_df, aes(x = bed, y = house_size)) +\n  geom_point() +\n  labs(title = \"Scatterplot House size vs Bed\",\n       x = \"Number Beds\",\n       y = \"House size\") +\n  theme_minimal()\n\nprint(scatter_bed_size)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# scatterplot Price vs bed\nscatter_bed_price <- ggplot(sample_df, aes(x = bed, y = price)) +\n  geom_point() +\n  labs(title = \"Scatterplot Price vs Bed\",\n       x = \"Number of Beds\",\n       y = \"House Price\") +\n  theme_minimal()\n\nprint(scatter_bed_price)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# scatterplot Price vs bath\nscatter_bath_price <- ggplot(sample_df, aes(x = bath, y = price)) +\n  geom_point() +\n  labs(title = \"Scatterplot Price vs Bath\",\n       x = \"Number of Baths\",\n       y = \"House Price\") +\n  theme_minimal()\n\nprint(scatter_bath_price)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# scatterplot Price vs house size\nscatter_size_price <- ggplot(sample_df, aes(x = house_size, y = price)) +\n  geom_point() +\n  labs(title = \"Scatterplot Price vs house_size\",\n       x = \"House Size\",\n       y = \"House Price\") +\n  theme_minimal()\n\nprint(scatter_size_price)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#Multi Linear regression model \nmodel <- lm(price ~ bed + bath + house_size, data = df)\n\n#check regression results\nsummary(model)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#plot model results\nplot(model)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#Check model","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#Create a calculater to calc house prices based on the results of My model","metadata":{"trusted":true},"execution_count":null,"outputs":[]}]}